import React from 'react';
import './A.css';

const Home = () => {
  const projectElements = [
    "User-friendly web interface for reporting garbage",
    "Interactive map to mark garbage locations",
    "Real-time updates and status tracking",
    "Notifications for city council responses",
    "Efficient database for garbage records",
    "Mobile-friendly design for easy access",
  ];

  return (
    <div className="home-container">
      <h1>Welcome to Garbage Collector</h1>
      <p>
        A platform dedicated to making your city cleaner and more sustainable.
        Here's what our project offers:
      </p>
      <ul className="project-list">
        {projectElements.map((element, index) => (
          <li key={index} className="project-list-item">
            {element}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
